import Layout from '../layout-components/layout';
import AdminSidebar from './admin-nav-sidebar';

function AdminLayout ({children}) {
    return(
        <Layout>
            <AdminSidebar /> 
            {children}
        </Layout>
    );
}

export default AdminLayout;
